import React from 'react';


const Question = (props) => {

    let ques = props.questions;
    console.log(ques);
    const list = ques.map((q) => {
        return (
            <li>{q.name}</li>
        )
    })
    return (
        <ul>
            {list}
        </ul>
    )
}

export default Question;
